(739, '160213733040', 'sum', '#include<iostream>\n#include<stdlib.h>\nusing namespace std;\nint main()\n{\n    int T,N,M;\n    cin>>T;\n    cout<<endl;\n    if(t<=0||t>10);\n    exit(0);\n    else\n    {\n        for(i=0;i<t;i++)\n        {\n            cin>>M>>N;\n            if(M!=N||M<0||M>5||N<0||N>5)\n            exit(0);\n            else\n            {\n                int a[M][M];\n                for(j=o;j<M;j++)\n                {\n                    for(int k=0;k<N;k++)\n                    cin>>a[M][M];\n                    cout<<endl;\n                    for(a=0;a<M;a++)\n                    {\n                        sum=sum+A[a][M-a-1];                \n                        sum1=sum1+A[a][b];\n                    }\n                    cout<<sum<<sum1<<endl;\n                \n            }\n    }\n    \n    return 0;\n}\n\nlimit.c: In function ‘void Init()’:\nlimit.c:46:16: warning: unused variable ‘r1’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                ^\nlimit.c:46:19: warning: unused variable ‘r2’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                   ^\ncpp: In function ‘int main()’:\ncpp:9:8: error: ‘t’ was not declared in this scope\n     if(t<=0||t>10);\n', 'CE', '2014-10-22 06:17:53', 'CPP', 'NA');
