(740, '160213733044', 'sum', '#include<stdio.h>\nvoid main\n{\n    int i,j,k,m,n,a[5][5];\n    printf("Enter the number of rows and coloumns");\n    scanf("%d%d",&m,&n);\n    if(m<5&&n<5)\n    {\n        for(i=0;i<5;i++)\n        {\n            for(j=0;j<5;j++)\n            printf("Matrix is valid");\n            scanf("%d",a[i][j]);\n        }\n    }\n    else \n    printf("Matrix is not valid");\n}\n\nlimit.c: In function ‘Init’:\nlimit.c:46:19: warning: unused variable ‘r2’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                   ^\nlimit.c:46:16: warning: unused variable ‘r1’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                ^\ncpp:3:1: error: expected ‘=’, ‘,’, ‘;’, ‘asm’ or ‘__attribute__’ before ‘{’ token\n {\n ^\n', 'CE', '2014-10-22 06:17:55', 'C', 'NA'),
(741, '160213733325', 'sum', '#include<iostream>\nusing namespace std;\nclass array\n{\n    int **a,**b,m,n,p,q,i,j;\n    public:\n    void read()\n    {\n    cout<<"enter elments of a:";\n    for(i=0;i<m;i++)\n    for(j=0;j<n;j++)\n    cout<<"enter elements of b";\n    for(i=0;i<m;i++)\n    for(j=0;j<n;j++)\n    }\n}\n\nlimit.c: In function ‘void Init()’:\nlimit.c:46:16: warning: unused variable ‘r1’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                ^\nlimit.c:46:19: warning: unused variable ‘r2’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                   ^\ncpp:16:1: error: expected ‘;’ after class definition\n }\n ^\n', 'CE', '2014-10-22 06:18:17', 'CPP', 'NA'),
(742, '160213733043', 'sum', '#include<iostream>\nusing namespace std;\nvoid main()\n{\nint t; int *p;\ncin>>t;\nif(t<0 && t>10)\n{\ncout<<"error t value";\nreturn;\n}\nint r,c;\ncin>>r;\ncin>>c;\nif(r<0 && r>5 && c<0 && c>5)\n{\n    cout<<"error value of i and j";\n    return;\n}\np=new int[r][c]\nfor(int i=0;i<r;i++)\n{\n    for(int j=0;j<c;j++)\n    cin>>p[i][j];\n}\nint sum1=0;\nfor(int i=0;i<r;i++)\n{\n    for(int j=0;j<c;j++)\n    {\n        if(i=j)\n        sum1=sum1+a[i][j];\n    }\n}\nint sum2=0;\nfor(int i=0;i<r;i++)\n{\n    for(int j=0;j<c;j++)\n    {\n    if((i+j)==(c+1))\n    sum2=sum2+a[i][j];\n}\n}\ncout<<sum1<<sum2;\n}\n\nlimit.c: In function ‘void Init()’:\nlimit.c:46:16: warning: unused variable ‘r1’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                ^\nlimit.c:46:19: warning: unused variable ‘r2’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                   ^\ncpp:3:11: error: ‘::main’ must return ‘int’\n void main()\n           ^\n', 'CE', '2014-10-22 06:19:28', 'CPP', 'NA'),
(743, '160213733303', 'sum', '#inciude<iostream.h>\nusing name space std;\nclass matrix\n{\nint a[10][10],i,m,m,n;\npublic:\nvoid read()\n{\ncout<<"enter the order of matrix"<<end/;\ncin>>m>>;}\nwhile(m=m)\ncout<<"<<m*n<<"elements of matrix".\nfor(i=0;i<n;i++);\nfor(j=0;j<n;j++)}\ncin>>a[i][j];}\n};\nmatrix m;\nm.read();\ngetch();\n}\n\n\nlimit.c: In function ‘void Init()’:\nlimit.c:46:16: warning: unused variable ‘r1’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                ^\nlimit.c:46:19: warning: unused variable ‘r2’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                   ^\ncpp:1:2: error: invalid preprocessing directive #inciude\n #inciude<iostream.h>\n  ^\n', 'CE', '2014-10-22 06:19:36', 'CPP', 'NA'),
(744, '160213733327', 'sum', '#include<iostream.>\nusing namespace std;\nclass matrix\n{\n    int a[10][10],i,j,m,n;\n    public:\n    void read()\n    {\n        do\n        {\n            cout<<<"enter the order of matrix"<<endl;\n            cin>>m>>n;\n        }\n        while(m!=n)\n        cout<<"enter <<m*n<<"elements of matrix";\n        for(i=0;i<n;i++)\n        {\n            for(j=0;j<n;j++)\n            {\n                cin>>a[i][j];\n            }\n        }\n        void diagnol()\n        {\n            cout<<"dignol matrix is:"<<endl;\n            for(i=0;i<n;i++)\n            {\n                for(j=0;j<n;j++)\n                {\n                    if(i!=j)\n                    a[i][j]=0;\n                    cout<<"\\t"<<a[i][j];\n                }\n                cout<<endl;\n            }\n        int main()\n        matrix m;\n        m.read;\n        m.daignol();\n        getch()\n        }\n        }\n    }\n}\n\n\nlimit.c: In function ‘void Init()’:\nlimit.c:46:16: warning: unused variable ‘r1’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                ^\nlimit.c:46:19: warning: unused variable ‘r2’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                   ^\ncpp:1:20: fatal error: iostream.: No such file or directory\n #include<iostream.>\n                    ^\n', 'CE', '2014-10-22 06:19:51', 'CPP', 'NA'),
(745, '160213733059', 'sum', '#include<iostream>\r\nusing namespace std;\r\nint main()\r\n{\r\n     int t,a[5][5],p[10],q[10],r,c;\r\n     cin>>t;\r\n     if(t>0 && t<10)\r\n     {\r\n     for(int k=0;k<t;k++)\r\n     {\r\n         cin>>r;\r\n         cin>>c;\r\n         if(r>0 && r<5 && c>0 && c<5)\r\n         {\r\n         if(r==c)\r\n         {\r\n             int sum=0;s=0,x;\r\n             for(int i=0;i<r;i++)\r\n             {\r\n                 for(int j=0;j<c;j++)\r\n                 {\r\n                     x=i+j;\r\n                     cin>>a[i][j];\r\n                     if(i==j)\r\n                     {\r\n                         sum=sum+a[i][j];\r\n                     }\r\n                     else if(x==(r-1))\r\n                     {\r\n                         s=s+a[i][j];\r\n                     }\r\n                 }\r\n             }\r\n             p[i]=sum;\r\n             q[i]=s;\r\n         }\r\n         }\r\n     }\r\n     }\r\n     for(int i=0;i<t;i++)\r\n     {\r\n         cout<<p[i]<<"\\t"<<q[i]<<endl;\r\n     }\r\n}\n\nlimit.c: In function ‘void Init()’:\nlimit.c:46:16: warning: unused variable ‘r1’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                ^\nlimit.c:46:19: warning: unused variable ‘r2’ [-Wunused-variable]\n  struct rlimit r1,r2,r3,r4; \n                   ^\ncpp: In function ‘int main()’:\ncpp:17:24: error: ‘s’ was not declared in this scope\n              int sum=0;s=0,x;\n', 'CE', '2014-10-22 06:21:09', 'CPP', 'NA'),
